import Home from './pages/Home';
import './styles/styles.scss';

class App extends React.Component {
  render() {
    return (
     <ApplicationRouter /> 
    )
  }
}

const ApplicationRouter = () => {
  return (
    <Router>
      <Switch>
        {
          routes.map(item => <CustomRoute {...item} />)
        }
      </Switch >
    </Router>
  )
}



export default App;
